import React, { Component } from 'react';
import "./About.css";
import profile_pic_name from "../assets/profile_pic.jpg";

export default class About extends Component {
  render() {
    return (
      <div>
        <div class="split left">
          <div className="centered">
            <img
            className="profile_image"
            alt="Profile Pic"
            ></img>
          </div>
          <div className="split right">
            <div className="centered">
              <div className="name_title"> Sydney Leonardi</div>
              <div className="brief description">
                 I am a computer science major at Vanderbilt University. I live in the suburbs of Chicago and love to take my french bulldog, Louie, on a walk by Lake Michigan. 
              </div>
            </div>
          </div>
      </div>
      </div>
    )
  }
}
